import { Nav, Container, Image, Row, Col, NavDropdown, Navbar } from "react-bootstrap";
import logo from './img/magazine.svg';

const HeaderApp = () => {
    return (
        <Container fluid>
            <Row>
                <Navbar className="custom-navbar">
            
                        <Image src={logo} className="size"></Image>

            
                        <Nav.Link to="/">Home</Nav.Link>
                        <Nav.Link to='/post'>Post</Nav.Link>
                        <NavDropdown title={<span>Category</span>}>
                            <Nav.Item>
                                <Nav.Link to='/post'>Discovery</Nav.Link>
                                <Nav.Link to='/post'>PC game</Nav.Link>
                                <Nav.Link to='/post'>Mobile game</Nav.Link>
                                <Nav.Link to='/post'>Console game</Nav.Link>
                            </Nav.Item>
                        </NavDropdown>

            
                        <Nav.Link to="/login">Login</Nav.Link>
                        <Nav.Link to='/register'>Register</Nav.Link>
  
                </Navbar>
            </Row>
        </Container>
    );
}

export default HeaderApp;
